news.description:
Önlem alın, panik yapmayın!

&nbsp;

Çin’in Vuhan kentinde Ocak ayında başlayan yeni koronavirüs (Covid 19) kaynaklı salgın bugün Türkiye’nin de içinde bulunduğu 123 ülkeye yayılmış durumda.

Bilim adamları salgına çare bulmak için çalışırken bizlere de büyük görev düşüyor.

Öncelikle panik yapmamamız ama salgını ciddiye almamız gerekiyor.

&nbsp;

Tüm dünyada ülkeler çeşitli kamusal tedbirleri devreye soktular.

Türkiye’de okullarda eğitime ara verildi, futbol karşılaşmalarının seyircisiz oynanma kararı alındı, son olarak bazı eğlence yerlerinin kapatılması kararı İçişleri Bakanlığı tarafından açıklandı.

&nbsp;

Bunların ötesinde alabileceğimiz çok basit ama etkili önlemler var ve bunlar büyük önem taşıyor.

İstisnasız tüm dünyada bilim insanları sosyal etkileşimden kaçınmamızı tembih ediyor.

Salgının geldiği bu noktada alacağımız basit önlemlerle; el yıkayarak, kol içine öksürerek, hastaysak maske takarak ve evde kalarak, sosyal mesafelenme kurallarına uyarak, bağışıklık sistemimizi güçlü tutarak ve doğru kaynaklardan bilgilenerek

&nbsp;

Hastalığın yayılım hızımı azaltabilir

&nbsp;

Hastanelerdeki yoğunluğu önleyebilir

&nbsp;

Dünyada sürmekte olan aşı/ilaç çalışmalarına zaman kazandırabilir

&nbsp;

Risk altında bulunan bireyleri koruyabiliriz.

Gedik Holding’in kaynak vana ve döküm alanlarında çalışan kadın çalışanları 8 Mart Dünya Emekçi Kadınlar Günü’nü alanında uzman kadınlarla bir arada keyifli bir panelle kutladı. Bütünsel Sağlık ve Ayurveda uzmanı Ebru Şinik, Gazeteci/Yazar, Radyo Gedik programcısı (İyilik Saplık) Füsun Saka, MasterCamp kurucu ortağı ve kariyer ve eğitim danışmanı, Radyo Gedik programcısı (Başıma Bir İş Geldi) Zuhal Gürçimen ile EFT ve Reiki uzmanı, Mutluluk Kolay tekniğinin yaratıcısı, Radyo Gedik programcısı (Mutluluk Kolay) &nbsp;Gülcan Arpacıoğlu’nun aralarında bulunduğu, Gedik Holding Yönetim Kurulu Başkanı Hülya Gedik’in de yer aldığı panelin moderatörlüğünü Gazeteci/Radyo Gedik Yayın Yönetmeni Hande Demirel üstlendi.

&nbsp;

Gedik Holding kadın çalışanlarının iş yaşam dengesinden sağlıklı yaşama pek çok alandaki sorularını yanıtlayan uzmanlar, kendi alanlarında önemli bilgileri paylaştı.

&nbsp;

Gedik Holding Yönetim Kurulu Başkanı Hülya Gedik yaptığı konuşmada, kadın erkek eşitliği konusunda en önemli rolün yine kadınlara düştüğünü ifade ederek şu değerlendirmelerde bulundu:

“Toplumumuzda kadının değerinin ortaya konulması için ailemizdeki biz kadınların duruşundan başlayarak erkek evlat yetiştirme süreçlerine kadar yine tüm görev biz kadınlara düşüyor. Bugün bize, Atatürk’ün dediği gibi; “Yeryüzünde gördüğünüz her şey kadınların eseridir” diyerek kadınları överken büyük bir sorumluluk da yüklüyor.

&nbsp;

Dünya Ekonomi Forumu 2016 raporuna göre kadın ve erkeğin iş hayatında eşit temsili için 117 sene gerektiği söyleniyor. Yani biz yaşam süremizce kadının ve erkeğin eşit şartlarda olduğunu göremeyeceğiz.

&nbsp;

Çalışan kadının kendine güveni tamdır, kimseye el açmaz, kimseye de muhtaç değildir. Kıymetli ozan Neşet Ertaş “Kadınlar İnsandır biz İnsanoğluyuz” deyişi ile kadınlara verilmesi gereken değerin altını yaldızlar ile çizmiştir.”

&nbsp;

Gedik Holding, faaliyet gösterdiği kaynak döküm vana gibi sanayi kollarında ve İstanbul Gedik Üniversitesi’nde cinsiyet eşitliği konusunda önemli çalışmalar yapmaktadır. Sanayide kadın çalışan sayısıyla öne çıkmasının yanı sıra, İstanbul Gedik Üniversitesi bünyesinde kurulan

Kadın ve Toplumsal Cinsiyet Araştırma Merkezi’nde toplumsal cinsiyet eşitliği konusunda bilimsel çalışmalar sürdürmektedir. İstanbul Gedik Üniversitesi ayrıca KAGİDER önderliğinde kadın istihdamını teşvik etmek için geliştirilen Fırsat Eşitliği Modeli (FEM) Programı kapsamında bağımsız bir denetleme sürecinden geçerek Fırsat Eşitliği Modeli Sertifası (SEM) almaya hak kazanan ilk üniversitedir.

&nbsp;

&nbsp;

members.description:
İnsan Kaynakları, Kurum Kültürü, İç İletişim konularında Profesyonel olarak 21 yıllık tecrübesi bulunan Nilay Karagülmez, Marmara Üniversitesi Arşivcilik Bölümünü 2.lik derecesiyle bitirdikten sonra, Sabancı Üniversitesi ve sonrasında Yurtdışında çeşitli okullarda Eğitimine devam etmiş ve hayat boyu öğrenme mottosunu asla unutmayıp halen okumaya devam eden, hayatın paylaştıkça çoğaldığına ve daha anlamlı olduğuna inanan, iyi derecede İngilizce, Osmanlıca ve Almanca bilen bir profesyoneldir. 11 yıldır profesyonel Koçluk yapmaktadır. Halen uluslararası bir Teknoloji firması olan SmartMessage’da Kıdemli İnsan ve Kurum Kültürü Direktörü olarak çalışma hayatına devam etmektedir.

&nbsp;

18 yaşından beri Yurtiçi ve Yurtdışında gezmeye devam eden, üniversite hayatı boyunca Kokartlı Rehber olarak çalışmış Nilay, bugüne kadar 25’in üzerinde ülkeye seyahat etmiş ve gittiği yerlerde edindiği bilgi birikimini etrafı ile paylaşmaya da devam etmeyi kendine ilke edinmiştir.  Bir çok Sivil Toplum Kuruluşu ile ortaklaşa çalışmalara katılmıştır ve halen Sabancı Vakfı’nın çalışmalarına katkıda bulunmaya devam etmektedir.

&nbsp;

2008 yılında Maltepe Üniversitesi psikoloji ve aynı zamanda felsefe bölümlerinden mezun olduktan sonra özel bir rehabilitasyon merkezinde engelli çocuklar ve aileleriyle çalışmaya başladım. Diğer yandan da “Felsefi Danışmanlık” konusu üzerine çalışarak yüksek lisansımı tamamladım. 2013 yılında doktora eğitimimi sürdürürken oğlumu dünyaya getirdim. Bu noktadan sonra hem emzirme konusu hem de anne – bebek ilişkileri odağım haline geldi. 2014 yılında Wageningen Universitesinin beslenmeye giriş programını ve Lactation Education Resources (ABD) medikal termnoloji eğitimlerini tamamladıktan sonra 2015 - 2016 yılları arasında Health e-Learning (Canada) ile emzirme konusunda detaylı bir eğitim programı tamamladım. 2016 yılından bu yana annelerimize yaşadıkları emzirme sorunlarında psikolojik destek başta olmak üzere emzirme danışmanlığı ve bebekleriyle güvenli ilişki kurmalarında rehberlik sağlıyorum. 2019 yılında yayımladığım kitabım “Bir Yaşam İksiri Anne Sütü” emzirme konusunun önemini aynı zamanda psikolojik açıdan da ele alan bir kitap oldu.

&nbsp;

&nbsp;

&nbsp;

İstanbul Üniversitesi, Sosyal Bilimler Fakültesi Pazar Araştırma ve Reklamcılık bölümünden mezun olan Serpil Güzel Ün, 1978 İstanbul doğumlu. Kendini Purpose Agency (Kolektif Amaç Ajansı) olarak konumlandıran Marjinal Porter Novelli’de, 20 senedir iletişim danışmalığı vermektedir.

Aralarında Tarih Vakfı, Yöret Vakfı, Adalar Vakfı, 1884 Vakfı, TELKODER, TARD, MEVA, KORUNCUK olmak üzere birçok sivil toplum kuruluşuna iletişim danışmanlığı vermiştir. 2016 yılından bu yana, markalarla sivil toplum arasında köprü kurup sosyal sorumluluk projeleri geliştiren MarjinalSosyal’ın proje koordinatörlüğünü yapmaktadır. 2017’de sosyal medya üzerinden başlatılan şu anda 25 sivil toplum kuruluşunun dahil olduğu Sosyal Bağış Hareketi’nin genel koordinatörüdür.

shows.description:
Daha iyi, enerjik, kaliteli yaşamak, sağlıkla yaş almak, formda kalmak hepimizin hayali. O zaman en güncel bilgiler, hayata geçirmesi kolay çözüm önerileri, pratik tariflerle iyi beslenmenin şifrelerini gelin birlikte çözelim.

Beslenmek karın doyurmak değil bedeni ve ruhu yeterli ve dengeli beslemektir. O zaman hak ettiğin o iyi yaşam için değişime hazır mısın?;

Unutma!

İyi yaşamayı hepimiz hak ediyoruz.

O zaman kendimize daha iyi bakmanın vakti geldi.

&nbsp;

Diyetisyen Berrin. Yiğit, “İYİ BESLEN” ile her Perşembe saat 10:00’da RADYO GEDİK’te sizlerle.

&nbsp;

&nbsp;

&nbsp;

Astrolojiden, beslenmeye; uykudan, dişil-eril dengesine; fiziksel egzersizden, meditasyona kadar hayatın her alanındaki konular ele alınacaktır.

Kişisel ve ruhsal gelişim ile ilgili kitapların yazarları programa konuk edilecektir.

&nbsp;

Meslek seçiminde toplumda kalıplaşmış mesleklerin dışına da çıkılabileceğini gösteren konuklarla; sınava hazırlanma süreci, kritik noktalar, ufak tefek tüyolar ile aslında korktuğumuz şeylerin sadece bir beyin algısı olduğunu göreceğiz.

Meslek seçiminin geri kalan yaşamın düzenine ne derece etki ettiğini; Dünya’nın aslında göründüğü kadar büyük olmadığını ve eğitim için Türkiye sınırlarının dışına da aslında nasıl kolay çıkılabileceğini konuşuyoruz.

Her Çarşamba  saat 14:00’de Eğitim Koçu ile testlerinize bir saatlik ara vermenizi bekliyorum. Full konsantrasyon için bir sade kahvenizi de hazır bulundurun.

&nbsp;

Finansal okuryazarlığınızı artıracak, ekonomiye daha anlamlı bakmanıza imkan verecek yeni bir program başlıyor. Ekonomi ve Finans gazetecisi Seyfi Akil her Cuma saat 15:00’de Radyo Gedik’te Eko Analiz ile karşınızda.

&nbsp;

&nbsp;

İstanbul Gedik Üniversitesi Gastronomi Bölümü öğrencileri Nilay Aslan, Kemal Emirhan Demirel ve Melih Edremit’in hazırlayıp sundundukları GastroSohbetler’de hem yemek hem kültür hem eğlence var. Her bölümde sürpriz konuklar da gençlere eşlik ediyor.

GastroSohbetler her Cuma saat 14:00’te Radyo Gedik’te.

&nbsp;

Üzülmeyin…

İŞİ GELİŞTİRMEK imdadınıza yetişiyor.

Bundan böyle Radyo Gedik’te zor zamanlarınızda yepyeni fikirlerin ampullerini yakacak, doğru bilinen yanlışları düzelteceğiz.

Üstelik şişirilmiş başarı hikayelerinden değil büyük başarısızlıklardan yola çıkıcaz.

&nbsp;

Hazır mısınız?

&nbsp;

Onur İlhan’ın hazırlayıp sunduğu İşi Geliştirmek  her Çarşamba Radyo Gedik’te.

&nbsp;

Türkiye’de işsizlik son verilerle yüzde 14,7 seviyesine çıktı.

Genç işşizlikte bu oran yüzde 26,7’de.

&nbsp;

O zaman bu mesele büyük mesele

Mesele memleket meselesi

&nbsp;

Radyo Gedik pek kıymetli bir programa daha imza atıyor

&nbsp;

Memleket meselesini

Çözümü bugünden bulanlarla konuşuyor.

Hali hazırda 5 milyona yaklaşan işsizler ordusuna hiç katılmayacak,

UMUTSUZ

HAYALSİZ kalmayacak

&nbsp;

KORKUSUZ ve ENDİŞESİZ yaşayacak gençler;

&nbsp;

İstanbul Gedik Üniversitesi Meslek Yüksek Okulu’nun cevval öğrencileri

Radyo Gedik’te buluşuyor.

&nbsp;

Eğitimde işbaşı nasıl olur, sizler için anlatıyor.

&nbsp;

&nbsp;

Nilay’ın Sırt Çantası, her Cuma 15.00 – 16.00 arası Radyo Gedik’te canlı ve podcastleri ile tüm dijital platformlarda.

&nbsp;

